import { FixedNumber } from 'ethers';
import React, { useEffect } from 'react';
import signer from '../blockchain/ethers.js';
import factory from '../blockchain/factory.js';
import { ethers } from 'ethers';
import '../css/stylesheet.css';

const Score = ({setScore, setEnded, setHeight, setBottom, score, ended, setNftPage, bottom}) => {

    const getScores = () => {

    }

    useEffect(() => {

    }, [score, ended])

    if (!ended){
        return (
            <>
                <div className="worldhighscore_div">
                    World High Score
                </div>
                <div className="worldhighscoreholder_div">
                    World High Score Holder
                </div>
                <div className="highscore_div">
                    High Score
                </div>
                <div className="score_div">
                    {score}
                </div>
            </>
        )
    }
    else if (bottom) {
        return(
            <>
                <div className="worldhighscore_div">
                    World High Score
                </div>
                <div className="highscore_div">
                    High Score
                </div>
                <div className="score_div">
                    {score}
                </div>
                <div className="gameover">
                    You're Trash
                </div>
                <button type="button" className="nft_button" onClick={ event => {
                    event.preventDefault();
                    setNftPage(true);
                }}>
                   Get NFT!
                </button>
                <button type="button" className="play_again_button1" onClick={ event => {
                    event.preventDefault();
                    setScore(0);
                    setEnded(false);
                    setHeight(100);
                    setBottom(false);
                }}>
                   Play
                </button>
            </>
        )
    }
    else {
        return(
            <>
                <div className="worldhighscore_div">
                    World High Score
                </div>
                <div className="highscore_div">
                    High Score
                </div>
                <div className="score_div">
                    {score}
                </div>
                <button type="button" className="nft_button" onClick={ event => {
                    event.preventDefault();
                    const delay1 = setTimeout(changeNftPage1, 800);
                    function changeNftPage1() {
                        setNftPage(true);
                        clearInterval(delay1);
                    };
                }}>
                   Get NFT!
                </button>
                <button type="button" className="play_again_button1" onClick={ event => {
                    event.preventDefault();
                    setScore(0);
                    setEnded(false);
                    setHeight(100);
                    setBottom(false);
                }}>
                   Play
                </button>
            </>
        )
    }
}

export default Score;
